//   });
// });
	
	
const paths = document.querySelectorAll('.map-container svg g g path');
const text = document.querySelector('.map-text-container p');

paths.forEach(path => {
  path.addEventListener('click', e => {
    // Reset fill color of all paths to its original value
    paths.forEach(p => p.style.fill = p.getAttribute('data-fill'));
    
    // Set fill color of clicked path to red
    e.target.style.fill = '#bf7171';
    
    // Set inner text of .text to title of clicked path
    text.innerText = e.target.getAttribute('title');
  });
  
  // Store original fill color for each path
  path.setAttribute('data-fill', path.style.fill);
});
	
	
	
	
	

</script>


